  return (
    <Layout>
    	<div>
      		<h1>About Montezuma</h1>
      		<AboutContent1 />
      		<AboutContent2 />




      <style jsx>{`
      	div {
      		text-align: center;
      		height: 1200px;
      	}

      `}</style>
    	</div>
    </Layout>
  );
}
